import Link from 'next/link'
import React from 'react'
import {Layout, Menu} from 'antd'
import {
    UserOutlined,
    MenuOutlined,

} from '@ant-design/icons'

const {Header} = Layout
const {SubMenu} = Menu

class HomePage extends React.Component {
    render(){
    return(
        <Layout>
            <Header>
            <Menu mode = 'horizontal'>
                <Menu.Item key = '1'>
                    <Link href = '/home'>
                        <a><MenuOutlined style={{fontSize: '30px'}}/></a>
                    </Link>
                </Menu.Item>
                <Menu.Item key = '2'>
                    <Link href = '/home'>
                        <a>UltiNote</a>
                    </Link>
                </Menu.Item>
                <Menu.Item key = '3' style={{float: 'right', textAlign: 'center'}}>
                    <Link href = '/home'>
                        <a><UserOutlined style={{fontSize: '30px'}}/></a>
                    </Link>
                </Menu.Item>
            </Menu>           
            </Header> 
        </Layout>  
    )
    }
}

export default HomePage

const styles = {
    nav: {
        padding: '10px',
        overflow: 'hidden',
        display: 'grid',
        gridTemplateColumns: 'repeat(6, 1fr)',
        gridGap: '10px',
    },
    pfp: {
        alignSelf: 'start',
        gridColumn: '6/6',
        gridRow: '1',
        marginRight: '16px',
        width: 'auto',
        border: '2px solid rgba(124,132,113,1)',
        borderRadius: '8px',
    },
    sideBar: {
        justifySelf: 'start',
        alignSelf: 'start',
        gridColumn: '1/6',
        gridRow: '1',
        width: 'auto',
        border: '2px solid rgba(124,132,113,1)',
        borderRadius: '8px',
    },
    title: {
        // justifySelf: 'start',
        // alignSelf: 'start',
        // gridColumn: '2/6',
        // gridRow: '1',
        // width: 'auto',
        // border: '2px solid tomato',
    }
}
